		<div class="para">
			<p style="color:#66AAFF">Some time worthy to be remembered.</p>
			<p class="day_title">相恋已经</p>
			<p class="days">{{days}}</p>
		</div>
		<div class="describe">2019/02/02 戊戌年冬月廿八</div>
		<div style="position: absolute;top:40%;background-color: rgba(216,216,216,0.5);left: 10%;right: 10%;border-radius: 15upx;">
			<p style="font-size: 65upx;font-style: italic;color:#353535;text-align:center;">金风玉露一相逢，便胜却，人间无数。</p>
			<p style="text-align: right;font-style: italic;color:#2C405A;font-size:25upx ;">————《鹊桥仙·纤云弄巧》</p>
		</div>
		<foot style="left:10%;right: 10%;top:97%;position: absolute;text-align: center;color:#000000;opacity: 0.6;font-size: 25upx;">@Nickname4th</foot>
	</div>

</template>


<script>
	export default {
		data() {
			return {
				title: 'Moment',
				days: ''
			}
		},
		onLoad() {

		},
		methods: {
			gettime() {
				var date1 = '2019/02/02 00:00:00'; //开始时间  
				var date2 = new Date(); //结束时间  
				var date3 = date2.getTime() - new Date(date1).getTime(); //时间差的毫秒数        
				//计算出相差天数  
				var days = Math.floor(date3 / (24 * 3600 * 1000))
				//计算出小时数  
				var leave1 = date3 % (24 * 3600 * 1000) //计算天数后剩余的毫秒数  
				var hours = Math.floor(leave1 / (3600 * 1000))
				//计算相差分钟数  
				var leave2 = leave1 % (3600 * 1000) //计算小时数后剩余的毫秒数  
				var minutes = Math.floor(leave2 / (60 * 1000))
				//计算相差秒数  
				var leave3 = leave2 % (60 * 1000) //计算分钟数后剩余的毫秒数  
				var seconds = Math.round(leave3 / 1000)
				this.days = days + "天" + hours + "小时" + minutes + "分钟" + seconds + "秒";
			},
		},


		mounted() {
			setInterval(this.gettime, 1000);
		},
		beforeDestroy() {
			clearInterval(this.timer);
		}
	}
</script>

